class Problem {
    // <func> // C#
// Input to this function is a string containing multiple groups of nested parentheses. Your goal is to
    // separate those group into separate strings and return the list of those.
    // Separate groups are balanced (each open brace is properly closed) and not nested within each other
    // Ignore any spaces in the input string.
    // >>> SeparateParenGroups(("( ) (( )) (( )( ))"))
    // (new List<string>(new string[]{(string)"()", (string)"(())", (string)"(()())"}))
    public static List<string> SeparateParenGroups(string paren_string) {
        List<string> groups = new List<string>();
        if (paren_string == null || paren_string.Length == 0) {
            return groups;
        }
        int open_count = 0;
        int close_count = 0;
        for (int I = 0; I < paren_string.Length; i++) {
            char c = paren_string[i];
            if (c == '(') {
                open_count++;
            } else if (c == ')') {
                if (open_count == 0) {
                    groups.Add(paren_string.Substring(0, i));
                }
                close_count++;
                open_count = 0;
            }
        }
        if (open_count > 0) {
            groups.Add(paren_string.Substring(0, i));
        }
        return groups;

