        string prefix = "";
        string suffix = "";
        for (int I = 0; I < n; i++) {
            if (i > 0 && str[i] == str[i - 1]) {
                maxLen++;
                prefix += str[i];
                suffix += str[i];
            }
            else {
                maxLen = Math.Max(maxLen, i - i % 2);
                prefix += str[i];
            }
        }
        if (maxLen == 1) {
            return prefix + suffix;
        }
        else {
            int len = maxLen;
            string palindrome = "";
            for (int I = 0; I < len; i++) {
                palindrome += prefix[i];
                palindrome += suffix[i];
            }
            return palindrome;
        }

