class Problem {
    // <func> // C#
// Input are two strings a and b consisting only of 1s and 0s.
    // Perform binary XOR on these inputs and return result also as a string.
    // >>> StringXor(("010"), ("110"))
    // ("100")
    public static string StringXor(string a, string b) {
        int n = a.Length;
        int m = b.Length;
        int[][] dp = new int[n + 1][];
        for (int I = 0; I <= n; i++) {
            dp[i] = new int[m + 1];
            for (int j = 0; j <= m; j++) {
                dp[i][j] = 0;
            }
        }
        for (int I = 1; I <= n; i++) {
            for (int j = 1; j <= m; j++) {
                if (a[i - 1] == b[j - 1]) {
                    dp[i][j] = dp[i - 1][j - 1] + 1;
                } else {
                    dp[i][j] = Math.Min(dp[i - 1][j], dp[i][j - 1]) + 1;
                }
            }
        }
        string result = "";
        for (int I = 1; I <= n; i++) {
            for (int j = 1; j <= m; j++) {
                if (dp[i][j] == 1) {
                    result += "1";
                } else {
                    result += "0";
                }
            }
            result += " ";
        }
        return result;

