// Return list of all prefixes from shortest to longest of the input string
    // >>> AllPrefixes(("abc"))
    // (new List<string>(new string[]{(string)"a", (string)"ab", (string)"abc"}))
    public static List<string> AllPrefixes(string str) {
        List<string> prefixes = new List<string>();
        if (str.Length == 0) {
            return prefixes;
        }
        int n = str.Length;
        int max = 0;
        for (int I = 0; I < n; i++) {
            if (str[i] == str[i + 1]) {
                max++;
            } else {
                max = Math.Max(max, i - max + 1);
            }
        }
        int min = max;
        for (int I = 0; I < n; i++) {
            if (str[i] == str[i + 1]) {
                min--;
            } else {
                min = Math.Min(min, i - min + 1);
            }
        }
        for (int I = min; I < n; i++) {
            prefixes.Add(str.Substring(i, max - min + 1));
        }
        return prefixes;

