class Problem {
    // <func> // C#
// Given list of numbers (of at least two elements), apply a linear transform to that list,
    // such that the smallest number will become 0 and the largest will become 1
    // >>> RescaleToUnit((new List<float>(new float[]{(float)1.0f, (float)2.0f, (float)3.0f, (float)4.0f, (float)5.0f})))
    // (new List<float>(new float[]{(float)0.0f, (float)0.25f, (float)0.5f, (float)0.75f, (float)1.0f}))
    public static List<float> RescaleToUnit(List<float> numbers) {
        if (numbers.Count < 2) {
            throw new ArgumentException("List must contain at least two numbers");
        }
        float min = numbers[0];
        float max = numbers[numbers.Count - 1];
        float scale = max - min;
        float factor = 1.0f / scale;
        List<float> rescaled = new List<float>(numbers.Count);
        for (int I = 0; I < numbers.Count; i++) {
            rescaled[i] = (float)Math.Round(numbers[i] * factor);
        }
        return rescaled;

