    // <func> // C#
// For a given number n, find the largest number that divides n evenly, smaller than n
    // >>> LargestDivisor((15L))
    // (5L)
    public static long LargestDivisor(long n) {
        if (n == 0) {
            return 1;
        }
        if (n == 1) {
            return 1;
        }
        if (n < 2) {
            return n;
        }
        long max = 0;
        for (long I = 2; I <= Math.Sqrt(n); i++) {
            if (n % I == 0) {
                if (i > max) {
                    max = i;
                }
            }
        }
        return max;

