    // >>> ChangeBase((8L), (3L))
    // ("22")
    // >>> ChangeBase((8L), (2L))
    // ("1000")
    // >>> ChangeBase((7L), (2L))
    // ("111")
    public static string ChangeBase(long x, long numBase) {
        if (numBase == 1) {
            return x.ToString();
        }
        if (x == 0) {
            return "0";
        }
        if (x < 0) {
            return "0" + ChangeBase(-x, numBase);
        }
        long remainder = x % numBase;
        if (remainder == 0) {
            return x.ToString();
        }
        return x.ToString() + "." + ChangeBase(remainder, numBase);

