    // >>> LargestPrimeFactor((13195L))
    // (29L)
    // >>> LargestPrimeFactor((2048L))
    // (2L)
    public static long LargestPrimeFactor(long n) {
        if (n < 2) {
            throw new ArgumentException("n must be greater than 1");
        }
        if (n == 2) {
            return 2;
        }
        if (n == 3) {
            return 3;
        }
        if (n % 2 == 0) {
            return n;
        }
        long primeFactor = 2;
        while (n % primeFactor == 0) {
            primeFactor = primeFactor * primeFactor;
            n /= primeFactor;
        }
        return primeFactor;

