        if (text == null) {
            return null;
        }
        byte[] bytes = Encoding.UTF8.GetBytes(text);
        using (MD5 md5 = MD5.Create()) {
            byte[] hash = md5.ComputeHash(bytes);
            StringBuilder sb = new StringBuilder();
            foreach (byte b in hash) {
                sb.Append(b.ToString("X2"));
            }
            return sb.ToString();
        }

